import React from 'react';
import styled from 'styled-components';
import Slider from "react-slick";

const StoryDiv=styled.div`
  border-radius:3px;
  border:solid 1px #dbdbdb;
  padding:16px 0;
  width:500px;
  height:100px;
`
function Story() {
  const settings={
    dots:true,
    sliderToShow:1,
    sliderToScroll:1,
    speed:500
  }
  return (
    <StoryDiv>
      <Slider {...settings}>
          <div>
            <h3>1</h3>
          </div>
          <div>
            <h3>2</h3>
          </div>
          <div>
            <h3>3</h3>
          </div>
          <div>
            <h3>4</h3>
          </div>
          <div>
            <h3>5</h3>
          </div>
          <div>
            <h3>6</h3>
          </div>
      </Slider>
    </StoryDiv>
  );
}

const data={}
export default Story;
